// src/apis/auth.ts
export const loginWithKakao = async (token: string) => {
    const response = await fetch('https://journeybuddy.com/oauth', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({ token }),
    });
    return response.json();
  };
export {};
